bablic.on("locale", function() {
    let languageSelected = bablic.getLocale();

    if (languageSelected == "fr") {
        $(".lg-item").removeClass("selected");
        $(".lg-item.fr").addClass("selected");
        $(".wrap-drop .selected-class p").html('French');
        $(".sl-tr, .wrap-drop .selected-class img").attr("src", "/assets/icons/flags/fr.svg");
    } else if (languageSelected == "de") {
        $(".lg-item").removeClass("selected");
        $(".lg-item.de").addClass("selected");
        $(".wrap-drop .selected-class p").html('German');
        $(".sl-tr, .wrap-drop .selected-class img").attr("src", "/assets/icons/flags/de.svg");
    } else if (languageSelected == "id") {
        $(".lg-item").removeClass("selected");
        $(".lg-item.id-tr").addClass("selected");
        $(".wrap-drop .selected-class p").html('Bahasa');
        $(".sl-tr, .wrap-drop .selected-class img").attr("src", "/assets/icons/flags/id-tr.svg");
    } else {
        $(".lg-item").removeClass("selected");
        $(".lg-item.en").addClass("selected");
        $(".wrap-drop .selected-class p").html('English');
        $(".sl-tr, .wrap-drop .selected-class img").attr("src", "/assets/icons/flags/usa-tr.svg");
    }
});

